import React from 'react';
import context from '../services/context';
var $ = require('jquery');

export default class WebChat extends React.Component {

    static contextType = context;

    static defaultProps = { }

    constructor(props) {

        super(props);

        this.setState = { };
    }

    componentDidCatch() {
        $("footer").removeClass("footer-fixed");
    }

    render() {

        const {state} = this;

        return (
            <div>

                { /* Div com as mensagens */  }
                <div className='row'>
                    <div className='col-12 col-sm-12 col-md-6 col-lg-6 col-xl-6 container'>


                    </div>
                </div>

                <div className='row'>
                    <div className='col-12 col-sm-12 col-md-6 col-lg-6 col-xl-6 container'>
                    <span>Bem vindo: <b style={{color:'Red'}}>{this.context.username}</b></span>

                    </div>
                </div>

            </div>
        )
    }
}
